import React from 'react';
import BaseCarousel from './core/BaseCarousel';
import ProfileCard from './ProfileCard';

const ProfileCardsCarousel = (props) => {
    const { theme } = props

    let mentors = []
    switch (theme) {
        case 'premium':
            mentors = [
                'Eric Schmidt',
                'Mark Zuckerberg',
                'Larry Page',
                'Elon Musk',
                'Bill Gates',
            ]
        default:
    }

    return (
        <BaseCarousel show={2}>
            { mentors.map( m => <ProfileCard name={m} /> ) }
        </BaseCarousel>
    )
};

export default ProfileCardsCarousel;
